import { Injectable } from '@angular/core';
import { TaskColumn } from '../models/task-column';
import { State } from '../enums/state';

@Injectable({
  providedIn: 'root'
})
export class TaskColumnService {
  static taskColumnList: TaskColumn[];

  constructor() { }

  taskColumnList: Array<TaskColumn> = [
    {columnName: "TODO List", columnState: State.TO_DO},
    {columnName: "In Progress", columnState: State.IN_PROGRESS},
    {columnName: "Work done", columnState: State.DONE}
  ];

  getTaskColumns(): TaskColumn[] {
    return this.taskColumnList;
  }
}
